function ($scope, $location, $http, spUtil, $timeout) {
    /**
     * A global object storing all base64 strings
     * that are used for displaying icons in a node template.
     */
    var pictureStrings = {
        user: "data:image/png;base64,",
        briefcase: "data:image/png;base64,",
        location: "data:image/png;base64,",
        email: "data:image/png;base64,",
        businessPhone: "data:image/png;base64,",
        mobilePhone: "data:image/png;base64,"
    };

    var client = this;
    console.log($scope.data);

    var $ = go.GraphObject.make;
    var orgChartDiagram =
        $(go.Diagram, "org-chart",
            {
                "undoManager.isEnabled": true,
                hoverDelay: 0

            });

    /**
     * Listen for a change to the search field value.
     * When an employee is searched for, pass their ID
     * to the server script and pull their first degree
     * of data and replace the current org chart with it.
     */
    $scope.$on("field.change", function (e, params) {
        client.data.event = "search";
        client.data.searchedEmployeeId = params.field.value;

        client.server.update().then(function (resp) {
            orgChartDiagram.startTransaction("Set searched data");

            // Find and remove all existing nodes on the org chart
            var existingNodes = [];
            orgChartDiagram.model.nodeDataArray.forEach(function (node) {
                existingNodes.push(node);
            });
            orgChartDiagram.model.removeNodeDataCollection(existingNodes);

            // Add the search results to the org chart
            orgChartDiagram.model.addNodeDataCollection(resp.nodes);

            // Expand and highlight the searched employee's node on the org chart
            var searchedEmployeeNode = orgChartDiagram.findNodeForKey(params.field.value);
            searchedEmployeeNode.findObject("addInfo").visible = true;
            searchedEmployeeNode.isSelected = true;
            orgChartDiagram.commitTransaction("Set searched data");
        });
    });

    $scope.resetToMe = function() {
        client.data.event = "reset";
        client.data.resetAction = "me";

        client.server.update().then(function (resp) {
            orgChartDiagram.startTransaction("Set searched data");

            // Find and remove all existing nodes on the org chart
            var existingNodes = [];
            orgChartDiagram.model.nodeDataArray.forEach(function (node) {
                existingNodes.push(node);
            });
            orgChartDiagram.model.removeNodeDataCollection(existingNodes);

            // Add the search results to the org chart
            orgChartDiagram.model.addNodeDataCollection(resp.nodes);
            orgChartDiagram.commitTransaction("Set searched data");
        });
    };

    $scope.resetToCEO = function() {
        client.data.event = "reset";
        client.data.resetAction = "ceo";

        client.server.update().then(function (resp) {
            orgChartDiagram.startTransaction("Set searched data");

            // Find and remove all existing nodes on the org chart
            var existingNodes = [];
            orgChartDiagram.model.nodeDataArray.forEach(function (node) {
                existingNodes.push(node);
            });
            orgChartDiagram.model.removeNodeDataCollection(existingNodes);

            // Add the search results to the org chart
            orgChartDiagram.model.addNodeDataCollection(resp.nodes);
            orgChartDiagram.commitTransaction("Set searched data");
        });
    };

    // this is shown by the mouseHover event handler
    var nodeHoverAdornment =
        $(go.Adornment, "Spot",
            {
                background: "transparent",
                // hide the Adornment when the mouse leaves it
                mouseLeave: function (e, obj) {
                    var ad = obj.part;
                    ad.adornedPart.removeAdornment("mouseHover");
                }
            },
            $(go.Placeholder,
                {
                    background: "transparent",  // to allow this Placeholder to be "seen" by mouse events
                    isActionable: false,  // needed because this is in a temporary Layer
                    click: function (e, obj) {
                        var node = obj.part.adornedPart;
                        node.diagram.select(node);
                    }
                }),
            $("Button", // Button to expand or collapse to parent
                new go.Binding("visible", "hasManager"),
                {alignment: go.Spot.Left, alignmentFocus: go.Spot.Right},
                {
                    click: function (e, obj) {
                        client.data.expandedUserId = obj.part.sh.key;
                        client.data.expandedUserDirection = "parent";

                        var clickedNode = orgChartDiagram.findNodeForKey(obj.part.sh.key);
                        orgChartDiagram.isTreePathToChildren = false;

                        if (clickedNode.isTreeExpanded) {
                            client.data.event = "collapse";
                            clickedNode.isTreeExpanded = false;
                        } else {
                            client.data.event = "expand";
                            clickedNode.isTreeExpanded = true;
                            orgChartDiagram.isTreePathToChildren = true;
                            // get manager and team
                            client.server.update().then(function (resp) {
                                console.log($scope.data.nodes);
                                $scope.data.nodes.forEach(function (node) {
                                    console.log(node);
                                    var nodeExists = orgChartDiagram.findNodeForKey(node.key);
                                    if (!nodeExists) {
                                        orgChartDiagram.model.addNodeData(node);
                                    }
                                });
                            });
                        }
                    }
                },

                //creates a buffer shape in the bottom, sets size/color and rotates it 180 degrees
                $(go.Shape, {figure: "buffer", fill: "darkBlue", angle: 180, desiredSize: new go.Size(17, 17)}),
                //makes button have no background and border and only has border on hover
                {"ButtonBorder.fill": null, "ButtonBorder.stroke": null, "_buttonFillOver": null}
            ),
            $("Button",// Button to expand or collapse to child
                new go.Binding("visible", "hasReports"),
                {alignment: go.Spot.Right, alignmentFocus: go.Spot.Left},
                {
                    click: function (e, obj) {
                        client.data.expandedUserId = obj.part.sh.key;
                        client.data.expandedUserDirection = "child";

                        var clickedNode = orgChartDiagram.findNodeForKey(obj.part.sh.key);
                        orgChartDiagram.isTreePathToChildren = true;

                        if (clickedNode.isTreeExpanded) {
                            client.data.event = "collapse";
                            clickedNode.isTreeExpanded = false;
                        }
                        else {
                            client.data.event = "expand";
                            clickedNode.isTreeExpanded = true;
                            // get reports
                            client.server.update().then(function (resp) {
                                console.log($scope.data.nodes);
                                $scope.data.nodes.forEach(function (node) {
                                    console.log(node);
                                    var nodeExists = orgChartDiagram.findNodeForKey(node.key);
                                    if (!nodeExists) {
                                        orgChartDiagram.model.addNodeData(node);
                                    }
                                });
                            });
                        }
                    }
                },

                //creates a buffer shape in the bottom, sets size/color and rotates it 180 degrees
                $(go.Shape, {figure: "buffer", fill: "darkBlue", desiredSize: new go.Size(17, 17)}),
                //makes button have no background and border and only has border on hover
                {"ButtonBorder.fill": null, "ButtonBorder.stroke": null, "_buttonFillOver": null})
        );


// A Node template for a user card
    orgChartDiagram.nodeTemplate =
        $(go.Node, "Auto",
            {
                click: function (e, obj) {
                    var isVisible = obj.part.findObject("addInfo").visible;
                    obj.part.findObject("addInfo").visible = !isVisible;
                },
                mouseHover: function (e, obj) {
                    var node = obj.part;
                    nodeHoverAdornment.adornedObject = node;
                    node.addAdornment("mouseHover", nodeHoverAdornment);

                }
            },
            $(go.Shape,
                {
                    fill: $(go.Brush, "Linear", {0: "white"}),
                    stroke: "darkblue", strokeWidth: 0.7, figure: "RoundedRectangle"
                }),


            //Panel for entire node
            $(go.Panel, "Table",

                {defaultAlignment: go.Spot.Left, column: 10, minSize: new go.Size(250, 0)},

                //Panel for picture
                $(go.Panel, "Table",
                    {
                        defaultAlignment: go.Spot.Left,
                        column: 0,
                        row: 0
                    },

                    $(go.Picture,
                        {
                            source: pictureStrings.user,
                            row: 0,
                            column: 0,
                            rowSpan: 3,
                            margin: new go.Margin(5),
                            width: 55,
                            height: 55
                        },
                        new go.Binding("source", "photo")
                    ),
                    $(go.Shape,
                        {
                            strokeWidth: 0,
                            stroke: null,
                            geometryString: "f M0 0 L100 0 L100 100 L0 100 z M5,50a45,45 0 1,0 90,0a45,45 0 1,0 -90,0 z",
                            width: 56,
                            height: 56,
                            fill: 'white',
                            margin: new go.Margin(5)
                        })
                ),

                //Panel for Pre-expanded information
                $(go.Panel, "Table",
                    {
                        defaultAlignment: go.Spot.Left,
                        column: 1,
                        row: 0,
                        width: 200,
                        defaultStretch: go.GraphObject.Horizontal
                    },

                    $(go.TextBlock, "Vertical",
                        {
                            row: 1,
                            column: 0,
                            margin: new go.Margin(5),
                            font: "Normal normal bold 15px Raleway"
                        },
                        new go.Binding("text", "name")),


                    $(go.TextBlock,
                        {
                            row: 3,
                            column: 0,
                            margin: new go.Margin(5),
                            alignment: go.Spot.Left,
                            font: "Italic normal normal 12px Raleway"
                        },
                        new go.Binding("text", "title")),
                ),

                //Panel for hidden info
                $(go.Panel, "Table",
                    {
                        name: "addInfo",
                        defaultAlignment: go.Spot.Left,
                        margin: new go.Margin(3, 5, 2, 7),
                        column: 1,
                        row: 1,
                        visible: false
                    },

                    $(go.Picture,
                        {
                            source: pictureStrings.briefcase,
                            row: 0,
                            column: 0,
                            alignment: go.Spot.Center,
                            margin: new go.Margin(7, 5, 0, 0),
                            width: 15,
                            height: 15
                        }
                    ),

                    $(go.TextBlock,
                        {
                            row: 0,
                            column: 1,
                            margin: new go.Margin(7, 0, 0, 3),
                            font: "Normal normal normal 12px Raleway"
                        },
                        new go.Binding("text", "department")),

                    $(go.Picture,
                        {
                            source: pictureStrings.location,
                            row: 1,
                            column: 0,
                            alignment: go.Spot.Center,
                            margin: new go.Margin(5, 5, 3, 0),
                            width: 10,
                            height: 15
                        }
                    ),

                    $(go.TextBlock,
                        {
                            row: 1,
                            column: 1,
                            margin: new go.Margin(5, 0, 3, 3),
                            font: "Normal normal normal 12px Raleway"
                        },
                        new go.Binding("text", "location")),


                    //line separator
                    $(go.RowColumnDefinition,
                        {row: 2, separatorStrokeWidth: .7, separatorStroke: "darkblue"}),

                    $(go.Picture,
                        {
                            source: pictureStrings.email,
                            row: 2,
                            column: 0,
                            alignment: go.Spot.Center,
                            margin: new go.Margin(7, 0, 0, 0),
                            width: 15,
                            height: 10
                        }
                    ),

                    $(go.TextBlock,
                        {
                            row: 2,
                            column: 1,
                            margin: new go.Margin(8, 0, 0, 3),
                            font: "Normal normal normal 12px Raleway"
                        },
                        new go.Binding("text", "email")),

                    $(go.Picture,
                        {
                            source: pictureStrings.businessPhone,
                            row: 3,
                            column: 0,
                            alignment: go.Spot.Center,
                            margin: new go.Margin(5, 5, 0, 0),
                            width: 13,
                            height: 13
                        }
                    ),

                    $(go.TextBlock,
                        {
                            row: 3,
                            column: 1,
                            margin: new go.Margin(5, 0, 0, 3),
                            alignment: go.Spot.Center,
                            font: "Normal normal normal 12px Raleway"
                        },
                        new go.Binding("text", "business_phone")),

                    $(go.Picture,
                        {
                            source: pictureStrings.mobilePhone,
                            row: 4,
                            column: 0,
                            alignment: go.Spot.Center,
                            margin: new go.Margin(5, 5, 5, 0),
                            width: 9,
                            height: 15
                        }
                    ),

                    $(go.TextBlock,
                        {
                            row: 4,
                            column: 1,
                            margin: new go.Margin(7, 0, 3, 3),
                            font: "Normal normal normal 12px Raleway"
                        },
                        new go.Binding("text", "mobilePhone")))
            )
        );

    orgChartDiagram.allowDelete = false;
    orgChartDiagram.model = $(go.TreeModel);
    orgChartDiagram.layout = $(go.TreeLayout, {angle: 360, layerSpacing: 100});

    $scope.data.nodes.forEach(function (node) {
        var nodeExists = orgChartDiagram.findNodeForKey(node.key);
        if (!nodeExists)
            orgChartDiagram.model.addNodeData(node);
    });

    orgChartDiagram.model.nodeKeyProperty = "key";

}
